// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;

/** 
 * @title PackagingAgreements
 * @dev Implements PackagingAgreements 
 */
contract PackagingAgreements {

    struct PackagingAgreement {
        uint id;
        string projectName;
        string internalNumber;
        string externalNumber;
        string processor;

        uint dueDate;
        uint trialDeliveryStartDate;
        uint productiveDeliveryStartdate;
        uint version;
        uint status;

        string materialNumberInternal;
    }

    struct MaterialDimensions {
        uint id;
        uint[2] length_breadth;
        uint weight;
        uint height;
        uint volume;
        uint fillingQuantity;

        string[2] lengthUOM_breadthUOM;
        string weightUOM;
        string heightUOM;
        string volumeUOM;
        string quantityUOM;
    }


    modifier onlyCreator() {
        require(msg.sender == creator, "Only the contract creator can call this method");
        _;
    }

    uint256 private index;
    address public creator;
    mapping(uint => PackagingAgreement) public packagingAgreement;
    mapping(uint => MaterialDimensions) public materialDimensions;

    constructor() {
        index = 0;
        creator = msg.sender;
    }

    function incrementIndex() internal{
        index += 1;
    }

    function createPackagingAgreement (
        string memory _projectName, 
        string memory _internalNumber,
        string memory _externalNumber,
        string memory _processor,

        uint _dueDate,
        uint _trialDeliveryStartDate,
        uint _productiveDeliveryStartdate,
        uint _version,
        uint _status,

        string memory _materialNumberInternal
    ) 
    public
    onlyCreator
    returns(uint)
    {
        incrementIndex();
        packagingAgreement[index] = PackagingAgreement(
            index, 
            _projectName, 
            _internalNumber,
            _externalNumber,
            _processor,
            _dueDate,
            _trialDeliveryStartDate,
            _productiveDeliveryStartdate,
            _version,
            _status,
            _materialNumberInternal
        );
        return index;
    }
    
    function createMaterialDimensions (
        uint _id,
        uint[2] memory _length_breadth,
        uint _weight,
        uint _height,
        uint _volume,
        uint _fillingQuantity,

        string[2] memory _lengthUOM_breadthUOM,
        string memory _weightUOM,
        string memory _heightUOM,
        string memory _volumeUOM,
        string memory _quantityUOM
    ) 
    public
    onlyCreator
    {
        materialDimensions[_id] = MaterialDimensions(
            _id, 
            _length_breadth, 
            _weight,
            _height,
            _volume,
            _fillingQuantity,
            _lengthUOM_breadthUOM,
            _weightUOM,
            _heightUOM,
            _volumeUOM,
            _quantityUOM
        );
    }

    function getPackagingAgreement(uint id) public view returns(PackagingAgreement memory){
        return packagingAgreement[id];
    }
    function getProjectName(uint id) public view returns(string memory){
        return packagingAgreement[id].projectName;
    }
    function getInternalNumber(uint id) public view returns(string memory){
        return packagingAgreement[id].internalNumber;
    }
    function getExternalNumber(uint id) public view returns(string memory){
        return packagingAgreement[id].externalNumber;
    }
    function getProcessor(uint id) public view returns(string memory){
        return packagingAgreement[id].processor;
    }
    function getMaterialNumberInternal(uint id) public view returns(string memory){
        return packagingAgreement[id].materialNumberInternal;
    }
    function getDueDate(uint id) public view returns(uint){
        return packagingAgreement[id].dueDate;
    }
    function getTrialDeliveryStartDate(uint id) public view returns(uint){
        return packagingAgreement[id].trialDeliveryStartDate;
    }
    function getProductiveDeliveryStartdate(uint id) public view returns(uint){
        return packagingAgreement[id].productiveDeliveryStartdate;
    }
    function getVersion(uint id) public view returns(uint){
        return packagingAgreement[id].version;
    }
    function getStatus(uint id) public view returns(uint){
        return packagingAgreement[id].status;
    }

    function getMaterialDimension(uint id) public view returns(MaterialDimensions memory){
        return materialDimensions[id];
    }
    function getMaterialDimensionLength(uint id) public view returns(uint, string memory){
        return (
            materialDimensions[id].length_breadth[0],
            materialDimensions[id].lengthUOM_breadthUOM[0]
        );
    }
    function getMaterialDimensionBreadth(uint id) public view returns(uint, string memory){
        return (
            materialDimensions[id].length_breadth[1],
            materialDimensions[id].lengthUOM_breadthUOM[1]
        );
    }
    function getMaterialDimensionWeight(uint id) public view returns(uint, string memory){
        return (
            materialDimensions[id].weight,
            materialDimensions[id].weightUOM
        );
    }
    function getMaterialDimensionHeight(uint id) public view returns(uint, string memory){
        return (
            materialDimensions[id].height,
            materialDimensions[id].heightUOM
        );
    }
    function getMaterialDimensionVolume(uint id) public view returns(uint, string memory){
        return (
            materialDimensions[id].volume,
            materialDimensions[id].volumeUOM
        );
    }
    function getMaterialDimensionQuantity(uint id) public view returns(uint, string memory){
        return (
            materialDimensions[id].fillingQuantity,
            materialDimensions[id].quantityUOM
        );
    }
}
